import './App.css';
import Navbar from './components/Navbar.js';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

import Home from './pages/Home.js';

function App() {
  return (
    <div className="App">
      <header>
        <BrowserRouter>
          <Navbar />
          <Routes>
            <Route index element={<Home />} />
          </Routes>
        </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
